const Paginado = (props) => {
return (
    <div>
        <h3>Pagina: {props.cu} {currentPage}</h3>
            <button onClick={prevHandler} >Prev</button>
            <button onClick={nextHandler} >Next</button>
        <h2>items</h2>
        <ul></ul>
    </div>
)
};

export default Paginado;
